import React, { useEffect, useState } from 'react';
import ChargersList from './ChargersList';
import SessionsList from './SessionsList';
import ChargerStatusCards from './ChargerStatusCards';
import ChargerConnectorsView from './ChargerConnectorsView';
import './index.css';

function App() {
  const [chargers, setChargers] = useState([]);
  const [sessions, setSessions] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [filterStatus, setFilterStatus] = useState(null);
  const [selectedCharger, setSelectedCharger] = useState(null);
  const [selectedConnector, setSelectedConnector] = useState(null);
  const [startDate, setStartDate] = useState('');
  const [endDate, setEndDate] = useState('');

  // Fetch chargers from backend every 30 seconds
  useEffect(() => {
    let interval;
    const fetchChargers = async () => {
      setLoading(true);
      try {
        const res = await fetch('/api/chargers');
        const data = await res.json();
        // Filtrar cargadores con al menos un conector de 60kW o mÃ¡s
        const filteredChargers = (data.chargers || []).filter(
          charger => charger.cnns && charger.cnns.some(conn => conn.power >= 60)
        );
        setChargers(filteredChargers);
        setError(null);
      } catch (err) {
        setError('Error al obtener los cargadores');
      } finally {
        setLoading(false);
      }
    };
    fetchChargers();
    interval = setInterval(fetchChargers, 30000);
    return () => clearInterval(interval);
  }, []);

  // Fetch sessions when switching to sessions view
  useEffect(() => {
    if (selectedConnector) {
      setLoading(true);
      fetch('/api/sessions')
        .then(res => res.json())
        .then(data => {
          setSessions(data.sessions || []);
          setError(null);
        })
        .catch(() => setError('Error al obtener las sesiones'))
        .finally(() => setLoading(false));
    }
  }, [selectedConnector]);

  // Filtrar sesiones por rango de fechas
  function filterSessionsByDate(sessions) {
    if (!startDate && !endDate) return sessions;
    return sessions.filter(s => {
      const start = s.startTime ? new Date(s.startTime) : null;
      const end = s.endTime ? new Date(s.endTime) : null;
      let inRange = true;
      if (startDate) {
        const from = new Date(startDate);
        inRange = inRange && (
          (start && start >= from) || (end && end >= from)
        );
      }
      if (endDate) {
        const to = new Date(endDate);
        inRange = inRange && (
          (start && start <= to) || (end && end <= to)
        );
      }
      return inRange;
    });
  }

  const filteredSessions = filterSessionsByDate(sessions);

  return (
    <div className="min-h-screen bg-gray-100 p-4">
      <div className="flex items-center justify-between mb-4">
        <h1 className="text-2xl font-bold text-gray-800">EV Chargers Monitor</h1>
        {(selectedCharger || selectedConnector) && (
          <button
            className="px-4 py-2 rounded bg-gray-200 text-gray-700 hover:bg-gray-300"
            onClick={() => {
              setSelectedConnector(null);
              setSelectedCharger(null);
            }}
          >Volver</button>
        )}
      </div>
      {/* Filtro de fechas */}
      {!selectedCharger && !selectedConnector && (
        <div className="flex flex-wrap gap-2 items-center justify-center mb-4">
          <label className="flex items-center gap-1 text-sm">Desde:
            <input type="date" value={startDate} onChange={e => setStartDate(e.target.value)} className="border rounded px-2 py-1 text-sm" />
          </label>
          <label className="flex items-center gap-1 text-sm">Hasta:
            <input type="date" value={endDate} onChange={e => setEndDate(e.target.value)} className="border rounded px-2 py-1 text-sm" />
          </label>
          {(startDate || endDate) && (
            <button onClick={() => { setStartDate(''); setEndDate(''); }} className="ml-2 px-2 py-1 rounded bg-gray-200 text-gray-700 hover:bg-gray-300 text-xs">Limpiar filtro</button>
          )}
        </div>
      )}
      {loading && <div className="text-center text-gray-500">Cargando...</div>}
      {error && <div className="text-center text-red-500">{error}</div>}
      {!loading && !error && !selectedCharger && !selectedConnector && (
        <>
          {/* Resumen de cargadores y conectores */}
          <div className="flex items-center justify-center gap-4 mb-2 text-gray-700">
            <span className="font-semibold">
              {chargers.length} cargadores rÃ¡pidos
            </span>
            <span className="text-xl">â¢</span>
            <span className="font-semibold">
              {chargers.reduce((sum, c) => sum + (c.connectors?.length || 0), 0)} conectores totales
            </span>
          </div>
          <ChargerStatusCards
            chargers={chargers}
            loading={loading}
            selected={filterStatus}
            onSelect={setFilterStatus}
          />
          <ChargersList
            chargers={filterStatus ? chargers.filter(c =>
              filterStatus === 'Charging' ? c.connectors.some(conn => conn.state === 'Charging') :
              filterStatus === 'Available' ? (!c.connectors.some(conn => conn.state === 'Charging') && c.connectors.some(conn => conn.state === 'Available')) :
              (!c.connectors.some(conn => conn.state === 'Charging') && !c.connectors.some(conn => conn.state === 'Available'))
            ) : chargers}
            onSelectCharger={setSelectedCharger}
            sessions={filteredSessions}
          />
        </>
      )}
      {/* Mostrar conectores de un cargador seleccionado */}
      {!loading && !error && selectedCharger && !selectedConnector && (
        <ChargerConnectorsView
          charger={selectedCharger}
          onSelectConnector={setSelectedConnector}
          sessions={filteredSessions}
        />
      )}
      {/* Mostrar sesiones de un conector seleccionado */}
      {!loading && !error && selectedConnector && selectedCharger && (
        <SessionsList
          sessions={filteredSessions.filter(s => s.chargerName === selectedCharger.name && s.connectorType === selectedConnector.type)}
          onBack={() => setSelectedConnector(null)}
          connector={selectedConnector}
        />
      )}
    </div>
  );
}

export default App;
